type Canvas = {
  canvRef: HTMLCanvasElement | null;
};

const CanvasComponent: React.FC<Canvas> = ({ canvRef }) => {
  return (
    <canvas
      ref={canvRef}
      style={{
        position: "absolute",
        marginLeft: "auto",
        marginRight: "auto",
        left: 0,
        right: 0,
        width: 640,
        height: 480,
        zIndex: 8,
      }}
    />
  );
};

export default CanvasComponent;
